sequence = b""

unicode_sinokorean_numbers = [b'\xec\x98\x81', b'\xec\x9d\xbc', b'\xec\x9d\xb4', b'\xec\x82\xbc', b'\xec\x82\xac', b'\xec\x98\xa4', b'\xec\x9c\xa1', b'\xec\xb9\xa0', b'\xed\x8c\x94', b'\xea\xb5\xac', b'\xec\x8b\xad']
numbers = [str(i).encode() for i in range(10)]
replace = zip(numbers, unicode_sinokorean_numbers)

for i in replace:
    sequence = sequence.replace(i[0], i[1])
